import './App.css';
import LogIn from './components/Login';
import {createBrowserRouter} from 'react-router-dom'

const router = createBrowserRouter([
  {
    path: '/',
    children: [
      {
        index: true,
        element: <Login/>
      },
      {
        path: 'home',
        element: <Home/>
      }
    ]
  }
])

function App() {
  return (
    <Login/>
  );
}

export default App;
